export function LandingPage () {
    return (
        <div className="landingpage">
            <Navbar/>
            <div >
                <div>
                    <div>
                        
                    </div>
                   <img src={bann2} alt="Banner image" />
                 </div>
                
                
            </div>
            <Footer/>
        </div>
    )
}
